var home_routes = [
  {   
    path: "/",
    name: "Home",
    icon: "nc-icon nc-bank",
    // component: <Dashboard />,
    layout: "/",
  },
  {   
    path: "/log-in",
    name: "Log In",
    icon: "nc-icon nc-bank",
    // component: <Dashboard />,
    layout: "/",
  },
  {
    path: "/sign-up",
    name: "Register Account",
    icon: "nc-icon nc-bank",
    // component: <Dashboard />,
    layout: "/",
  },
];
export default home_routes;
